ep_second": "2082-07-01", "day_options": ["All", "Friday", "Monday", "Saturday", "Sunday", "Thursday", "Tuesday", "Wednesday"], "type_options": ["ALL", "DAM", "RTM"], "default_first_ad": "2024-07-16", "default_second_ad": "2025-10-18", "csv_url": "https://imloololrtufqywapowk.supabase.co/storage/v1/object/public/flat-data/summary/latest/summary.csv", "default_block1": "00:00-00:15", "default_blockn": "23:45-24:00", "col_names": {"DATE_AD": "_DATE", "DAY": "_DAY", "TYPE": "_TYPE", "NEPALI": "Nepali_Date"}}</script>

<script>
(function() {
  const payload = JSON.parse(document.getElementById('data-json').textContent);
  const rows = payload.rows;
  const blocks = payload.block_cols.slice();
  const hasNepali = payload.has_nepali;
  const NEP_COL = payload.nep_col || "";
  const nepDates = payload.nep_dates || [];

  const DATE = payload.col_names["DATE_AD"];   // "_DATE" (AD)
  const DAY  = payload.col_names["DAY"];       // "_DAY"
  const TYPE = payload.col_names["TYPE"];      // "_TYPE"
  const NEP  = payload.col_names["NEPALI"];    // original "Nepali_Date" name if present

  // controls
  const modeAD  = document.getElementById('modeAD');
  const modeBS  = document.getElementById('modeBS');
  const adWrap  = document.getElementById('adControls');
  const bsWrap  = document.getElementById('bsControls');
  const fAD     = document.getElementById('firstDateAD');
  const sAD     = document.getElementById('secondDateAD');
  const fBS     = document.getElementById('firstDateBS');
  const sBS     = document.getElementById('secondDateBS');
  const daySel  = document.getElementById('dayName');
  const typeSel = document.getElementById('typeSel');
  const b1Sel   = document.getElementById('blockStart');
  const bnSel   = document.getElementById('blockEnd');

  // enable BS mode if we actually have Nepali_Date
  if (hasNepali && NEP_COL) {
    modeBS.disabled = false;
    document.getElementById('nepAvail').textContent = "";
  } else {
    modeBS.disabled = true;
    document.getElementById('nepAvail').textContent = "(Nepali_Date not found in CSV)";
  }

  // populate AD defaults
  fAD.value = payload.default_first_ad || "";
  sAD.value = payload.default_second_ad || "";

  // populate BS defaults
  function populateBS(selectEl, values) {
    selectEl.innerHTML = "";
    values.forEach(v => {
      const o = document.createElement('option');
      o.value = v; o.textContent = v;
      selectEl.appendChild(o);
    });
  }
  populateBS(fBS, nepDates);
  populateBS(sBS, nepDates);
  if (nepDates.length) {
    fBS.value = payload.default_nep_first || nepDates[0];
    sBS.value = payload.default_nep_second || nepDates[nepDates.length-1];
  }

  // show/hide groups based on mode
  function refreshMode() {
    if (modeAD.checked) {
      adWrap.style.display = "";
      bsWrap.style.display = "none";
    } else {
      adWrap.style.display = "none";
      bsWrap.style.display = "";
    }
  }
  modeAD.addEventListener('change', refreshMode);
  modeBS.addEventListener('change', refreshMode);
  refreshMode();

  // populate Day/Type/Blocks
  (payload.day_options || ["All"]).forEach(v => {
    const o = document.createElement('option'); o.value=v; o.textContent=v; daySel.appendChild(o);
  });
  // Force uppercase options: ALL, DAM, RTM (ALL default)
  (payload.type_options || ["ALL","DAM","RTM"]).forEach(v => {
    const txt = (v||"").toUpperCase();
    const o = document.createElement('option'); o.value=txt; o.textContent=txt; typeSel.appendChild(o);
  });
  blocks.forEach(v => {
    const o1=document.createElement('option'); o1.value=v; o1.textContent=v; b1Sel.appendChild(o1);
    const o2=document.createElement('option'); o2.value=v; o2.textContent=v; bnSel.appendChild(o2);
  });
  daySel.value = "All"; typeSel.value = "ALL";
  b1Sel.value = payload.default_block1 || blocks[0];
  bnSel.value = payload.default_blockn || blocks[blocks.length-1];

  function inRange(d, lo, hi) {
    if (!d) return false;
    if (lo && d < lo) return false;
    if (hi && d > hi) return false;
    return true;
  }

  // -------- helpers for numeric calc ----------
  function num(v) {
    if (v === null || v === undefined) return null;
    const n = Number(String(v).replace(/[, ]/g, ''));
    return Number.isFinite(n) ? n : null;
  }

  function rowStats(r, span) {
    let mn=null, mx=null, s=0, n=0;
    span.forEach(c => {
      const v = num(r[c]);
      if (v === null) return;
      if (mn === null || v < mn) mn = v;
      if (mx === null || v > mx) mx = v;
      s += v; n += 1;
    });
    return { min: (mn===null? "": mn), max: (mx===null? "": mx), avg: (n? s/n: "") };
  }

  function addAggregateRows(rowsWithStats, span) {
    // per-block aggregates:
    const aggMin = {}, aggMax = {}, aggAvg = {};
    span.forEach(c => {
      let mn=null, mx=null, s=0, n=0;
      rowsWithStats.forEach(r => {
        const v = num(r[c]);
        if (v === null) return;
        if (mn===null || v<mn) mn=v;
        if (mx===null || v>mx) mx=v;
        s+=v; n+=1;
      });
      aggMin[c] = (mn===null? "": mn);
      aggMax[c] = (mx===null? "": mx);
      aggAvg[c] = (n? s/n: "");
    });

    // rollups from per-row stats
    let minOfMin=null, maxOfMax=null, sAvg=0, nAvg=0;
    rowsWithStats.forEach(r => {
      const rmin = num(r.__MIN), rmax = num(r.__MAX), ravg = num(r.__AVG);
      if (rmin!==null) minOfMin = (minOfMin===null ? rmin : Math.min(minOfMin, rmin));
      if (rmax!==null) maxOfMax = (maxOfMax===null ? rmax : Math.max(maxOfMax, rmax));
      if (ravg!==null) { sAvg += ravg; nAvg += 1; }
    });

    const aggMinRow = Object.assign({}, aggMin, {
      _LABEL: "Aggregate-Min",
      __MIN: (minOfMin===null? "": minOfMin),
      __MAX: "",
      __AVG: ""
    });
    const aggMaxRow = Object.assign({}, aggMax, {
      _LABEL: "Aggregate-Max",
      __MIN: "",
      __MAX: (maxOfMax===null? "": maxOfMax),
      __AVG: ""
    });
    const aggAvgRow = Object.assign({}, aggAvg, {
      _LABEL: "Aggregate-Avg",
      __MIN: "",
      __MAX: "",
      __AVG: (nAvg? sAvg/nAvg: "")
    });

    return [aggMinRow, aggMaxRow, aggAvgRow];
  }
  // -------------------------------------------

  function filterRows() {
    const useBS = modeBS.checked && hasNepali && NEP_COL;

    let lo="", hi="", dateField="";
    if (useBS) {
      lo = (document.getElementById('firstDateBS').value)||"";
      hi = (document.getElementById('secondDateBS').value)||"";
      dateField = NEP_COL;
    } else {
      lo = (document.getElementById('firstDateAD').value)||"";
      hi = (document.getElementById('secondDateAD').value)||"";
      dateField = DATE;
    }

    const day = (daySel.value||"All").toLowerCase();
    const typSel = (typeSel.value||"ALL").toUpperCase();

    return rows.filter(r => {
      const d = (r[dateField]||"").trim();
      const dn = (r[DAY]||"").trim().toLowerCase();
      const tp = (r[TYPE]||"").toUpperCase();

      if (!(d && (!lo || d>=lo) && (!hi || d<=hi))) return false;
      if (day !== "all" && dn !== day) return false;

      if (typSel === "ALL") {
        // include both DAM and RTM
        return true;
      } else {
        // include only the chosen market
        return (tp.includes("_"+typSel) || tp === typSel);
      }
    });
  }

  function selectedBlockSpan() {
    const start = b1Sel.value;
    const end   = bnSel.value;
    const i1 = blocks.indexOf(start);
    const i2 = blocks.indexOf(end);
    if (i1 < 0 || i2 < 0) return [];
    const a = Math.min(i1,i2), b = Math.max(i1,i2);
    return blocks.slice(a, b+1);
  }

  // ----------- NEW: helpers to compute DAM/RTM/IEX series -----------
  function seriesAvgByType(filtered, span, typeNeedle) {
    // typeNeedle = "DAM" or "RTM"
    return span.map(c => {
      let s=0, n=0;
      filtered.forEach(r => {
        const tp = (r[TYPE]||"").toUpperCase();
        if (!(tp.includes("_"+typeNeedle) || tp === typeNeedle)) return;
        const raw = r[c];
        if (raw === "" || raw === null || raw === undefined) return;
        const v = Number(String(raw).replace(/,/g,''));
        if (Number.isFinite(v)) { s+=v; n+=1; }
      });
      return n ? s/n : null;
    });
  }

  function combineIEX(yDam, yRtm) {
    // per-block mean of whichever exist (if only one is present, IEX equals it)
    const out = [];
    const L = Math.max(yDam.length, yRtm.length);
    for (let i=0;i<L;i++) {
      const a = yDam[i];
      const b = yRtm[i];
      const vals = [];
      if (Number.isFinite(a)) vals.push(a);
      if (Number.isFinite(b)) vals.push(b);
      if (!vals.length) out.push(null);
      else out.push(vals.reduce((x,y)=>x+y,0)/vals.length);
    }
    return out;
  }
  // ------------------------------------------------------------------

  function isSingleSelectedDay() {
    // single-day if AD dates equal (and set) OR BS equal (and set)
    if (modeAD.checked) {
      const a = (document.getElementById('firstDateAD').value)||"";
      const b = (document.getElementById('secondDateAD').value)||"";
      return !!a && a === b;
    } else {
      const a = (document.getElementById('firstDateBS').value)||"";
      const b = (document.getElementById('secondDateBS').value)||"";
      return !!a && a === b;
    }
  }

  function renderChart(filtered, span) {
    const useBS = modeBS.checked && hasNepali && NEP_COL;
    const labelField = useBS ? NEP_COL : DATE;
    const dayChosen = (daySel.value || "All").toLowerCase() !== "all";
    const typeIsAll = (typeSel.value || "ALL").toUpperCase() === "ALL";
    const singleDay = isSingleSelectedDay();
    const container = document.getElementById('chart');
    const traces = [];

    // Your requested behavior:
    // - If Type=ALL and (day chosen OR single selected day): show DAM, RTM, IEX.
    // - If Type=ALL and Day=All: show IEX only.
    // - Otherwise preserve previous behavior.
    if (typeIsAll && (dayChosen || singleDay)) {
      const yDam = seriesAvgByType(filtered, span, "DAM");
      const yRtm = seriesAvgByType(filtered, span, "RTM");
      const yIex = combineIEX(yDam, yRtm);

      traces.push({ x: span, y: yDam, mode: 'lines+markers', name: 'DAM',
        hovertemplate: 'Block: %{x}<br>DAM: %{y}<extra></extra>' });
      traces.push({ x: span, y: yRtm, mode: 'lines+markers', name: 'RTM',
        hovertemplate: 'Block: %{x}<br>RTM: %{y}<extra></extra>' });
      traces.push({ x: span, y: yIex, mode: 'lines+markers', name: 'IEX (Avg of DAM & RTM)',
        hovertemplate: 'Block: %{x}<br>IEX: %{y}<extra></extra>' });

      var title = (dayChosen ? ('By block — ' + (daySel.value||'')) : 'By block — single day')
                   + ' | Type: ALL';
    } else if (typeIsAll && !dayChosen && !singleDay) {
      // IEX only across all rows
      const means = span.map(c => {
        let s=0, n=0;
        filtered.forEach(r => {
          const raw = r[c];
          if (raw === "" || raw === null || raw === undefined) return;
          const v = Number(String(raw).replace(/,/g,''));
          if (Number.isFinite(v)) { s += v; n += 1; }
        });
        return n ? s/n : null;
      });
      traces.push({
        x: span, y: means, mode: 'lines+markers', name: 'IEX (All rows)',
        hovertemplate: 'Block: %{x}<br>Avg: %{y:.2f}<extra></extra>'
      });
      var title = "Average across all days (IEX)";
    } else {
      // previous behavior
      const day = daySel.value || "All";
      if (day.toLowerCase() !== "all") {
        filtered.forEach(r => {
          const y = span.map(c => r[c] === "" ? null : Number(String(r[c]).replace(/,/g,'')));
          traces.push({
            x: span, y: y, mode: 'lines+markers', name: r[labelField],
            hovertemplate: 'Block: %{x}<br>Value: %{y}<extra>%{fullData.name}</extra>'
          });
        });
        var title = (useBS ? "Nepali_Date" : "DATE") + " — " + day + " (block-wise)";
      } else {
        const means = span.map(c => {
          let s=0, n=0;
          filtered.forEach(r => {
            const raw = r[c];
            if (raw === "" || raw === null || raw === undefined) return;
            const v = Number(String(raw).replace(/,/g,''));
            if (Number.isFinite(v)) { s += v; n += 1; }
          });
          return n ? s/n : null;
        });
        traces.push({
          x: span, y: means, mode: 'lines+markers', name: 'Avg across all rows',
          hovertemplate: 'Block: %{x}<br>Avg: %{y:.2f}<extra></extra>'
        });
        var title = "Average across all days (filtered)";
      }
    }

    const layout = {
      title, xaxis: {title: 'Block'}, yaxis: {title:'Value'},
      template: 'plotly_white', legend: {title:(useBS ? "Nepali_Date" : "DATE")},
      margin: {l:40,r:20,t:60,b:40}, hovermode: 'x unified'
    };
    Plotly.react(container, traces, layout, {responsive:true, displayModeBar:false});
  }

  let dt = null;
  function renderTable(filtered, span) {
    // Build rows with per-row stats
    const rowsWithStats = filtered.map(r => {
      const st = rowStats(r, span);
      // show DATE (AD) in the first column label
      return Object.assign({}, r, { __MIN: st.min, __MAX: st.max, __AVG: st.avg, _LABEL: r[DATE] });
    });

    // Aggregate rows (3)
    const aggRows = addAggregateRows(rowsWithStats, span);

    // Columns: DATE / Nepali (if any) / Day / Type / span blocks / Min Max Avg
    const cols = [];
    cols.push({title: 'DATE', data: '_LABEL'});
    if (hasNepali && NEP_COL) cols.push({title: 'Nepali_Date', data: NEP_COL});
    cols.push({title: 'Day Name', data: DAY});
    cols.push({title: 'Date_Type', data: TYPE});
    span.forEach(c => cols.push({title: c, data: c}));
    cols.push({title: 'Min', data: '__MIN'});
    cols.push({title: 'Max', data: '__MAX'});
    cols.push({title: 'Avg', data: '__AVG'});

    const tableData = rowsWithStats.concat(aggRows);

    const elId = 'dataTable';
    const wrap = document.getElementById('tableWrap');
    wrap.innerHTML = `<table id="${elId}" class="display compact nowrap" style="width:100%"></table>`;

    if (dt) { try { dt.destroy(); } catch(e) {} dt = null; }

    dt = new $.fn.dataTable.Api($('#'+elId).DataTable({
      data: tableData,
      columns: cols,
      paging: true, searching: true, ordering: true,
      scrollY: '420px', scrollX: true, deferRender: true, scroller: true,
      createdRow: function(row, data) {
        const label = data._LABEL || '';
        if (label === 'Aggregate-Min' || label === 'Aggregate-Max' || label === 'Aggregate-Avg') {
          $(row).css({'font-weight':'600','border-top':'2px solid #999'});
        }
      },
      columnDefs: [
        {
          targets: '_all',
          render: function(data, type) {
            if (data === "" || data === null || data === undefined) return "";
            if (type === 'display' && !isNaN(Number(data))) {
              const n = Number(data);
              return Number.isFinite(n) ? n.toLocaleString() : data;
            }
            return data;
          }
        }
      ]
    }));
  }

  function update() {
    const filtered = filterRows();
    const span = selectedBlockSpan();
    $('#rowCount').text(`Rows: ${filtered.length}`);
    renderChart(filtered, span);
    renderTable(filtered, span);
  }

  // Initial render with defaults
  update();

  // Generate button
  document.getElementById('generateBtn').addEventListener('click', update);
})();
</script>

</body>
</html>
